#!/bin/bash

[ -z "$1" ] && {
    echo "you need to specify amount as parameter"
    exit 1
}

remove=$1
banknotes="500 200 100 50 10 5 1"

count_banknotes()
{
    full_list=$(cat)
    sorted=$(echo "${full_list}" | sort -u)
    echo "${sorted}" | while read b; do
        cnt=$(echo "${full_list}" | grep "^${b}$" | wc -l)
        echo "${cnt} ${b} banknotes"
    done
}

withdraw()
{
    sum=$1
    unset counter;

    while [ ${sum} -gt 0 ]; do
        for i in ${banknotes}; do
            [ ${sum} -gt ${i} ] || [ ${sum} -eq ${i} ] && {
                sum=$((sum - i))
                echo "${i}"
                break
            }
        done
    done
}

withdraw ${remove} | count_banknotes

