const int INF = 1e9 + 7;
const double EPS = 1e-10;
const int MOD = 1e9 + 7;
const int MAXN = 2e3 + 100;

int n, m;
char a[MAXN][MAXN];
int dist[MAXN][MAXN];

int dx[] = {-1, 0, 1, 0};
int dy[] = {0, 1, 0, -1};

inline void solve() {
    cin >> n >> m;
    pair<int, int> start;
    for (int i = 0; i < n; ++i) {
        for (int j = 0; j < m; ++j) {
            cin >> a[i][j];
            dist[i][j] = -1;
            if (a[i][j] == 'X') {
                start = {i, j};
            }
        }
    }

    int mx = 0, cnt = 0;
    bool odd = false, even = false;
    queue<pair<int, int>> q;
    q.push(start);
    dist[start.first][start.second] = 0;
    while (!q.empty()) {
        auto [i, j] = q.front();
        q.pop();
        if (a[i][j] == 'I') {
            odd |= (dist[i][j] % 2 == 0);
            even |= (dist[i][j] % 2 == 1);
            mx = max(mx, dist[i][j]);
            ++cnt;
            continue;
        }
        for (int k = 0; k < 4; ++k) {
            int x = i + dx[k], y = j + dy[k];
            if (x >= 0 && x < n && y >= 0 && y < m) {
                if (a[x][y] != 'B' && dist[x][y] == -1) {
                    q.emplace(x, y);
                    dist[x][y] = dist[i][j] + 1;
                }
            }
        }
    }
    for (int i = 0; i < n; ++i) {
        for (int j = 0; j < m; ++j) {
            if (a[i][j] == 'I' && dist[i][j] == -1) {
                cout << "-1\n";
                return;
            }
        }
    }
    if (odd && even) {
        cout << "-1\n";
    } else {
        cout << cnt * mx << '\n';
    }
}


