function getRandomSymbol() {
    const symbols = ["U", "D", "L", "R"];
    const randomIndex = Math.floor(Math.random() * symbols.length);
    return symbols[randomIndex];
}

async function makeRequests() {

    let token = '';

    // POST on Join
    await axios.post('http://10.211.55.9:8080/api/v1/game/join', {
        // Replace with your actual data
        'userName': 'Julius Can',
        'mapId': 'map1'
    })
    .then(response => {
        assert.strictEqual(response.status, 200, 'Expected status code 200');
        token = response.data.authToken;
        //console.log(response.data); // Uncomment this line to see the response
    })
    .catch(error => {
        console.error(error);
    });

    // Replace 'your_token' with your actual token
    //const token = '7da9c5411cfbef3842fac78e62892786';
    const config = {
        headers: { Authorization: `Bearer ${token}` }
    };

    // GET on State (jsut to check if the token is valid)
    await axios.get('http://10.211.55.9:8080/api/v1/game/state', config).then(response => {
        assert.strictEqual(response.status, 200, 'Expected status code 200');    
        //console.log(response.data); // Uncomment this line to see the response
    });

    const r_time = 15; // Replace with your actual value

    for (let i = 0; i < 100; i++) {

        const move_direction = getRandomSymbol();
        const tick_period = Math.floor(Math.random() * ((r_time * 900) - 10 + 1)) + 10;

        // POST on Tick
        await axios.post('http://10.211.55.9:8080/api/v1/game/tick', {
            // Replace with your actual data
            // data: {
            //     "timeDelta": tick_period
            // }
            'timeDelta': tick_period
        })
        .then(response => {
            //console.log(response.data); // Uncomment this line to see the response
        })
        .catch(error => {
            console.error(error);
        });

        // POST on Action (move player)
        await axios.post('http://10.211.55.9:8080/api/v1/game/player/action', {
            // Replace with your actual data
            'move': move_direction
        }, config)
        .then(response => {
            //console.log(response.data); // Uncomment this line to see the response
        })
        .catch(error => {
            console.error(error);
        });
    }
}

